import styled from 'styled-components'

const NavBar = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  height: 70px;
  border: 1px solid navy;

  .greeting{
    margin: 0;
    font-size: 40px;
    font-weight: 700;
  }

  .amount {
    width: 50px;
    height: 50px;
    font-size: 30px;
  }
`
export function Nav() {
  return (
    <div>
      <NavBar>
        <p className='greeting'>G'day!</p>
        <div className='amount'>3</div>
      </NavBar>
    </div>
  )
}
